description:
latest opensuse 11.0 release has been pushed to the network as of today.

here you find the cd iso images (livecd, netbootcd) and the deltaiso images (use applydeltaiso)

windows users beware, applydeltaiso.exe from &lt;a href=&quot;
http://gifuyana.com/wapplydeltaiso/wapplydeltaiso.html&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://gifuyana.com/wapplydeltaiso/wapplydeltaiso.html&lt;/a&gt;
is incompatible with the new compression scheme (lzma) that has been introduced during the opensuse 11.0 development stages.


apply the deltaiso images to the latest public rc1 release of opensuse 11.0 that can be found at many mirrors, sites and torrents. &lt;a href=&quot;
http://en.opensuse.org/Mirrors_Development_Build&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://en.opensuse.org/Mirrors_Development_Build&lt;/a&gt;
 &lt;a href=&quot;
http://download.opensuse.org/distribution/11.0-RC1/iso/cd/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://download.opensuse.org/distribution/11.0-RC1/iso/cd/&lt;/a&gt; &lt;a href=&quot;
http://download.opensuse.org/distribution/11.0-RC1/iso/torrent/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://download.opensuse.org/distribution/11.0-RC1/iso/torrent/&lt;/a&gt;
